import './NavBarStyle.css';

function NavBar(){

    let handleChange = (e) => {
        e.preven
        console.log(e.target.key);
    }

    return(
        <nav>
            <div class="logo">
                Portfolio
            </div>
            <input type="checkbox" id="click"/>
            <label for="click" class="menu-button">
                <i class="fas fa-bars"></i>
            </label>
            <ul>
                <li key={1}>
                    <a href="index.html" class="active" onClick={handleChange}>Home</a>
                </li>
                <li key={2}>
                    <a href="about.html" onClick={handleChange}>About</a>
                </li>
                <li key={3}>
                    <a href="timeline.html" onClick={handleChange}>Timeline</a>
                </li>
                <li key={4}>
                    <a href="contact.html" onClick={handleChange}>Contact</a>
                </li>
            </ul>
        </nav>
    );
}

export default NavBar;
